import React from "react";
import{PhlaNaam,AakhriNaam} from "./Thanda";
const Pepsi =()=>{
    return (<>
        <PhlaNaam.Consumer>{
        (fname)=>{ return(<>
         <AakhriNaam.Consumer>{
              (lname)=>{
                  return(
                <h1>Hello BBy {fname} {lname}</h1>);
             }
         }</AakhriNaam.Consumer></>);

         }}
        </PhlaNaam.Consumer>
    </>);
};
export default Pepsi;
